import React, {useEffect} from 'react';

function Home(){
    useEffect(()=> {
        (
            
            async () => {
                setInterval(()=>{
                    fetch('http://127.0.0.1:8000/api/timecalculate'); // будет вызываться 1 раз в сек. 
                },1000);
                const response = await fetch('http://127.0.0.1:8000/api/user', {
                    method: 'GET',
                    headers: {'Content-Type': 'application/json', 'X-Requested-With': 'XMLHttpRequest'},
                    credentials: 'include',
                });
                const content = await response.json();
                console.log(content);
            }
        )()
        }
    )


    return(
        <div className="App">
            Home
        </div>
    )
}

export default Home;
